sap.ui.define(function(){"use strict";class t{constructor(){this._eventRegistry=new Map}attachEvent(t,e){const s=this._eventRegistry;const n=s.get(t);if(!Array.isArray(n)){s.set(t,[e]);return}if(!n.includes(e)){n.push(e)}}detachEvent(t,e){const s=this._eventRegistry;const n=s.get(t);if(!n){return}const r=n.indexOf(e);if(r!==-1){n.splice(r,1)}if(n.length===0){s.delete(t)}}fireEvent(t,e){const s=this._eventRegistry;const n=s.get(t);if(!n){return[]}return n.map(t=>t.call(this,e))}fireEventAsync(t,e){return Promise.all(this.fireEvent(t,e))}isHandlerAttached(t,e){const s=this._eventRegistry;const n=s.get(t);if(!n){return false}return n.includes(e)}hasListeners(t){return!!this._eventRegistry.get(t)}}return t});